import React from 'react';

const Dashboard = () => {
  const totalCustomers = 1;
  const totalBookings = 0;
  const totalProducts = 13;

  const styles = {
    dashboard: {
      textAlign: 'center',
      padding: '3px'
    },
    header: {
      backgroundColor: '#333',
      padding: '15px',
      color: 'white'
    },
    nav: {
      display: 'flex',
      justifyContent: 'center',
      marginBottom: '20px'
    },
    navLink: {
      color: 'white',
      margin: '0 15px',
      textDecoration: 'none'
    },
    navLinkHover: {
      textDecoration: 'underline'
    },
    metrics: {
      display: 'flex',
      justifyContent: 'space-around',
      margin: '40px 0'
    },
    metric: {
      backgroundColor: '#f4f4f4',
      padding: '20px',
      borderRadius: '8px',
      width: '150px'
    },
  };

  return (
    <div style={styles.dashboard}>
      <header style={styles.header}>
        <h1>Online Medical Shop Admin</h1>
        <nav style={styles.nav}>
          <a href="#" style={styles.navLink}>Home</a>
          <a href="#" style={styles.navLink}>View User</a>
          <a href="#" style={styles.navLink}>View Booking</a>
          <a href="#" style={styles.navLink}>View Feedback</a>
          <a href="#" style={styles.navLink}>Products</a>
          <a href="#" style={styles.navLink}>Category</a>
          <a href="#" style={styles.navLink}>Logout</a>
        </nav>
      </header>

      <div style={styles.metrics}>
        <div style={styles.metric}>
          <h2>Total Customer</h2>
          <p>{totalCustomers}</p>
        </div>
        <div style={styles.metric}>
          <h2>Total Booking</h2>
          <p>{totalBookings}</p>
        </div>
        <div style={styles.metric}>
          <h2>Total Product</h2>
          <p>{totalProducts}</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
